Chlebowo is a &lt;a href="village"&gt;village&lt;/a&gt; in the administrative district of &lt;a href="Gmina%20Bulkowo"&gt;Gmina Bulkowo&lt;/a&gt;, within &lt;a href="P%C5%82ock%20County"&gt;Płock County&lt;/a&gt;, &lt;a href="Masovian%20Voivodeship"&gt;Masovian Voivodeship&lt;/a&gt;, in east-central Poland. It lies approximately west of &lt;a href="Bulkowo"&gt;Bulkowo&lt;/a&gt;, east of &lt;a href="P%C5%82ock"&gt;Płock&lt;/a&gt;, and north-west of &lt;a href="Warsaw"&gt;Warsaw&lt;/a&gt;.
